INSERT INTO `groups` (`id`, `name`, `description`, `context`, `email`, `image`, `restrict_access`, `chat_link`, `drive_link`, `status`, `state`, `visibility`, `creator_id`, `creation_date`) VALUES
	(1, 'GT Finances', 'Ce groupe s\'occupe de gérer les finances de l\'association. Il gère les dons, les dépenses, les demandes d\'argent, et gère le compte bancaire.', 'Ce groupe a été créé après un problème avec les finances. Le problème était que trop peu de personnes s\'en occupaient.', NULL, 'group_5ecjoxx4zzza8cni2zv4t523buef6n.jpg', 0, 'chat.link/join?v=i2su8tlmu6', 'drive.link/open?f=tzi97qs6wrarsyvzmjmu033m02afg0cjjg9plvvmamozv8xcj4gqmgi4o41g7hb4d', 'Travail une fois par mois pour les tâches répétitives', 3, 1, 45, '2019-07-28 02:59:52'),
	(2, 'GT Réfléxion interne', 'Groupe pour réfléchir au fonctionnement interne.', 'Différentes tensions entre certains membres.', NULL, 'group_oivabk34kanwygt3vywoeplzf0lqox.jpg', 0, 'chat.link/join?v=840dons4juvqs', 'drive.link/open?f=n29yxt11lwlnbllwv5ef2f5ck76xqpvwv14getv93e2kz1yq9eh0h', '', 1, 1, 51, '2019-01-22 03:37:45'),
	(3, 'Coordination', 'Coordination générale. Fait des AG toutes les 2 semaines.', 'Besoin d\'un groupe contenant tout les membres.', 'coordination@assoc.ch', 'group_ufgdaawfard697vev4q7biit5onz1v.jpg', 0, 'chat.link/join?v=epua9fjs78', 'drive.link/open?f=bw9eww9ppp03s7as1p5p7dh86xr1xrvz3mirk6otrfhecil1fys', '', 1, 1, 59, '2019-05-01 22:42:47'),
	(4, 'GT Journal', 'Collaboration avec un journal régional mensuel pour un prochain numéro consacré à l\'association. Le journal sera publié fin mai.', 'Envie de prendre place dans l\'espace médiatique et de se faire connaître...', 'journal@assoc.ch', NULL, 0, 'chat.link/join?v=kv7ls62a9fjc8', 'drive.link/open?f=lsgs2q2wbtp24bglexpaz7oto01q6fcoa5o8goan7pezhq3iqdyr8jctlyi9wcj4', 'En pause pour cause du covid et reporté en septembre.', 2, 1, 60, '2019-02-03 07:19:38'),
	(5, 'GT Festival', 'Organise les "festivals" annuels de l\'association.', '', 'festival@assoc.ch', 'group_2mzics1tk66xw6d3q6hsqmplj4pqud.jpg', 0, 'chat.link/join?v=cfo4h70gmdp', 'drive.link/open?f=d1oghlb9mej1j7bvyt8begfzasrtpmqdz79sju16xm0cdab07cztn4h9q1', '', 1, 1, 16, '2019-05-01 18:25:05'),
	(6, 'GT Multimédia', 'Crée tous les design et médias dont l\'association a besoin. Affiches, vidéos, photos, montages, ...', 'Rassemblement des personnes créatives de l\'association.', NULL, 'group_2fg2k8ip25uujr77t4tfyegn4puusp.jpg', 1, 'chat.link/join?v=52hu1od0oxbhj', 'drive.link/open?f=29d9qqgpo4wm7bbtqiqgmjs6ewzl8sa3356t295les861advgb2p9xbk2rp', 'Peu actif...', 2, 0, 17, '2020-04-25 09:47:27'),
	(7, 'GT Sites web', 'Ce GT s\'occupe des sites web et de leur maintenance.', 'Besoin de connaissances un peu technique et des personnes qui se portent responsables.', NULL, NULL, 0, 'chat.link/join?v=sgttqdx8tuu', 'drive.link/open?f=8c6pvm04sg46kzwuk5o2fcm7wwd5jtk0nfdr0ogblv0zwy8yf1afm157mu3hem', 'Travail actif sur le site cantonal...', 1, 1, 78, '2020-02-22 19:43:41'),
	(8, 'GT Communication', 'Gére toute la communication interne et externe de l\'association. Gère les différents réseaux sociaux.', '', 'communication@assoc.ch', NULL, 0, 'chat.link/join?v=lp6tnisvaa', 'drive.link/open?f=7st3msgbx56akty0mgqk62d5p1duksozotw4raxii7w4twukgmr0dpbp', 'Textes et messages envoyés tous les jours. Très actif pour la réfléxion.', 2, 1, 17, '2019-06-17 08:18:10'),
	(9, 'GT Education', 'Fait des formations en ligne pour des membres internes et externes.', 'Volonté de se former au thèmes de l\'association.', NULL, NULL, 0, 'chat.link/join?v=ehdq3i5ioihst0', 'drive.link/open?f=m6m3tbkd8uvq490r2hm7kkhmty3v5ht109bencfqrssuog3ngnen3dxbnzg9icyb4', 'Formations intenses entre le 15 et le 23. Ensuite pause.', 1, 1, 88, '2020-03-04 02:39:24'),
	(10, '"GT" relations', 'Permet de gérer les relations externes, que ce soit les médias, la presse, les demandes d\'interview, ...', 'Beaucoup de demandes d\'interview après pour les événements organisés.', NULL, NULL, 0, 'chat.link/join?v=z3lvnhod0v', 'drive.link/open?f=trodn4kg7qo45bcxkyj5u3we1kebvk1g66adzcnnnudom8plz0sd8ih6hv2uj5fg0zlw1', '', 1, 1, 89, '2019-03-29 00:27:12'),
	(11, 'GT boîte mail', 'Gestion de la boite mail et réponses aux messages.', '', NULL, 'group_blwt3uw94psz9n8xtmy1fym3exo8b2.jpg', 0, 'chat.link/join?v=8lqkhoq53oblo', 'drive.link/open?f=en935auw6r7icidz7qyas6d1omdvkcqs0pp9ougawb5k2hdfmhwwccp94is371es', 'Une personne gère la boite mail par jour et ce tous les jours.', 1, 1, 45, '2019-07-04 03:13:40');
